import me from "../img/me.jpg";
import "./styles/homeStyles.css"

function Home() {
  return (
    <div id="me">
      <h1>Welcome,</h1>
      <p>
        Hello, I'm Carlos Almanza a fullstack web-dev student at Denver University. Check me out and let's build together.
      </p>
      <a href="" target="_blank">
      <div>
        <img src={me} alt="me"/>
    </div>
    </a>
    </div>
  );
}

export default Home;
